import React from "react";
import { StyleSheet } from "react-native";

const StyleHeader = StyleSheet.create({
    header: {
        width:'100%',
        height: '8%',
        backgroundColor: '#E7E6E4',
        borderBottomLeftRadius: 18,
        borderBottomRightRadius: 18,
    }
});

export default StyleHeader;
